import React, { useState } from "react";
import "./App.css";

function App(){  
  const [width,setWidth] = useState(window.innerWidth)

  function print1(){
    console.log("print1")
    window.alert("print1 function")
  }
  function print2(){
    console.log("print2")
    window.alert("print2 function")
  }
  function print3(){
    console.log("print3")
    window.alert("print3 function")
  }
  function print4(){
    console.log("print1")
    window.alert("print4 function")
  }

  return (
    <div className="App"> 
      {print1()}
      {print2()}
      {print3()}
      {print4()}
      <h2> {width} </h2>
      <button type="button" onClick={()=>setWidth("900")}> change width </button>
    </div>
  )
}

export default App;
